import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom/client';
import axios from 'axios';


function ComName() {
    return (
      <div>
        <h1>Create a Community</h1>
        <p>Build and grow a community about something you care about. We'll help you set things up.</p>
        <input className="w90" type="text" placeholder="Name" />
        <p>Name cannot be changed later</p>
      </div>
    );
  }
  
  function ComType() {
    return (
      <div className="type">
        <h2>TYPE</h2>
        <ul className="typeslist">
          <li>
            <input type="radio" id="public" name="communityType" value="public" />
            <label className="ml10" htmlFor="public">Public</label>
          </li>
          <li>
            <input type="radio" id="restricted" name="communityType" value="restricted" />
            <label className="ml10" htmlFor="restricted">Restricted</label>
          </li>
          <li>
            <input type="radio" id="private" name="communityType" value="private" />
            <label className="ml10" htmlFor="private">Private</label>
          </li>
        </ul>
      </div>
    );
  }
  
  function CreateCommunity() {
    const [isAdultContent, setIsAdultContent] = useState(false);
  
    const handleCreate = () => {
      // Here you can submit the community data to the server
      console.log('Creating community...');
    };
  
    return (
      <div>
        <ComName />
        <ComType />
        <div className="adult">
          <div className="adult-header">Adult Content</div>
          <div className="adultCheckbox">
            <input
              type="checkbox"
              checked={isAdultContent}
              onChange={(e) => setIsAdultContent(e.target.checked)}
            />
            <label>18+ year old community</label>
          </div>
        </div>
        <div className="cancelcreate">
          <button className="cancel">Cancel</button>
          <button className="create" onClick={handleCreate}>Create</button>
        </div>
      </div>
    );
  }
  
  export default function Community() {
    const [communities, setCommunities] = useState([]);
  
    useEffect(() => {
      // Fetch communities from the mock server
      axios.get('https://jsonplaceholder.typicode.com/communities')
        .then(response => {
          setCommunities(response.data);
        })
        .catch(error => {
          console.error('Error fetching communities:', error);
        });
    }, []);
  
    return (
      <div>
        <h1>Communities</h1>
        <ul>
          {communities.map(community => (
            <li key={community.id}>{community.name}</li>
          ))}
        </ul>
      </div>
    );
  }
